    VALUES
        (0, x'5AFA34F7BB032E7B4B80F40A', '2018-05-14 14:39:00.172000', '<p>El contrarrec&iacute;proco de la siguiente proposici&oacute;n: &quot;si x es un cuadril&aacute;tero, entonces no es un tri&aacute;ngulo y tiene 4 lados&quot; es:</p>\r\n', 'A', 1, x'5AFA34F7BB032E7B4B80F40F', 0, '<p>Si x es un tri&aacute;ngulo y no tiene 4 lados, entonces no es un cuadril&aacute;tero</p>\n', x'5AFA34F7BB032E7B4B80F40E', 0, '<p>Si x no es un tri&aacute;ngulo &oacute; no tiene 4 lados, entonces es un cuadril&aacute;tero</p>\n', x'5AFA34F7BB032E7B4B80F40D', 0, '<p>Si x no es un tri&aacute;ngulo &oacute; tiene 4 lados, entonces es un cuadril&aacute;tero</p>\n', x'5AFA34F7BB032E7B4B80F40C', 0, '<p>Si x no es un tri&aacute;ngulo &oacute; no tiene 4 lados, entonces no es cuadril&aacute;tero</p>\n', x'5AFA34F7BB032E7B4B80F40B', 1, '<p>Si x es un tri&aacute;ngulo &oacute; no tiene 4 lados, entonces no es un cuadril&aacute;tero</p>\n', x'5AF65950DADE1B4EE775BEE3', 'RU');
