    VALUES
        (0, x'5AFA3704BB032E7B4B80F410', '2018-05-14 14:39:00.172000', '<p>Si las proposiciones a) ~ p &Uacute; q b) r &reg; q son ambas falsas, entonces en relaci&oacute;n con las proposiciones</p>\r\n\r\n<p>I.&nbsp; &nbsp;&nbsp;p es verdadera.</p>\r\n\r\n<p>II. &nbsp;&nbsp;p ^&nbsp;~ r es falsa.</p>\r\n\r\n<p>III. &nbsp;q es verdadera.</p>\r\n\r\n<p>&iquest;Cu&aacute;les son correctas?</p>\r\n', 'A', 1, x'5AFA3704BB032E7B4B80F415', 0, '<p>Solo I</p>\n', x'5AFA3704BB032E7B4B80F414', 0, '<p>Solo II</p>\n', x'5AFA3704BB032E7B4B80F413', 1, '<p>Solo I y II</p>\n', x'5AFA3704BB032E7B4B80F412', 0, '<p>II y III</p>\n', x'5AFA3704BB032E7B4B80F411', 0, '<p>I, II y III</p>\n', x'5AF65950DADE1B4EE775BEE3', 'RU');
