        (0, x'5AFA3C15BB032E7B4B80F446', '2018-05-14 14:39:00.172000', '<p>Determine el siguiente t&eacute;rmino de la sucesi&oacute;n:</p>\r\n\r\n<p>109 A ; 111 C ; 113 E ; 115 G ; 117 I ; ....</p>\r\n', 'A', 1, x'5AFA3C15BB032E7B4B80F44B', 0, '<p>119 A</p>\n', x'5AFA3C15BB032E7B4B80F44A', 1, '<p>119 B</p>\n', x'5AFA3C15BB032E7B4B80F449', 0, '<p>119 C</p>\n', x'5AFA3C15BB032E7B4B80F448', 0, '<p>119 G</p>\n', x'5AFA3C15BB032E7B4B80F447', 0, '<p>119 H</p>\n', x'5AF65A7BDADE1B4EE775BEF2', 'RU');
