        (0, x'5AFA3C3CBB032E7B4B80F44C', '2018-05-14 14:39:00.172000', '<p>Seleccione entre las alternativas dadas, el t&eacute;rmino que sigue en la siguiente sucesi&oacute;n:</p>\r\n\r\n<p>1 Z , 7 X , 25 V , 79 T , 241 R , . . .</p>\r\n', 'A', 1, x'5AFA3C3CBB032E7B4B80F451', 0, '<p>363 P</p>\n', x'5AFA3C3CBB032E7B4B80F450', 1, '<p>403 P</p>\n', x'5AFA3C3CBB032E7B4B80F44F', 0, '<p>565 P</p>\n', x'5AFA3C3CBB032E7B4B80F44E', 0, '<p>603 P</p>\n', x'5AFA3C3CBB032E7B4B80F44D', 0, '<p>727 P</p>\n', x'5AF65A7BDADE1B4EE775BEF2', 'RU');
