    VALUES
        (0, x'5AFA3CECBB032E7B4B80F452', '2018-05-14 14:39:00.172000', '<p>De acuerdo a la informaci&oacute;n brindada en la figura, se desea determinar la magnitud del di&aacute;metro del c&iacute;rculo menor.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:165px; width:119px" /></p>\r\n\r\n<p>Informaci&oacute;n brindada</p>\r\n\r\n<p>I. La suma de las &aacute;reas de los dos c&iacute;rculos interiores es 3/4 del &aacute;rea del c&iacute;rculo exterior.</p>\r\n\r\n<p>II. x + y = z</p>\r\n\r\n<p>Para resolver el problema:</p>\r\n', 'A', 1, x'5AFA3CECBB032E7B4B80F457', 0, '<p>La informaci&oacute;n I es suficiente</p>\n', x'5AFA3CECBB032E7B4B80F456', 0, '<p>La informaci&oacute;n II es suficiente</p>\n', x'5AFA3CECBB032E7B4B80F455', 0, '<p>Es necesario emplear ambas informaciones a la vez</p>\n', x'5AFA3CECBB032E7B4B80F454', 0, '<p>Cada informaci&oacute;n por separado, es suficiente</p>\n', x'5AFA3CECBB032E7B4B80F453', 1, '<p>La informaci&oacute;n brindada es insuficiente</p>\n', x'5AF65B00DADE1B4EE775BEFA', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFA3D2CBB032E7B4B80F458', '2018-05-14 14:39:00.172000', '<p>Se desea determinar el &aacute;rea de un c&iacute;rculo dibujado en un plano cartesiano.</p>\r\n\r\n<p>Informaci&oacute;n brindada:</p>\r\n\r\n<p>I. El c&iacute;rculo es tangente al eje de las ordenadas.</p>\r\n\r\n<p>II. Un di&aacute;metro del c&iacute;rculo pasa por el punto (2,0)</p>\r\n\r\n<p>Para resolver el problema:</p>\r\n', 'A', 1, x'5AFA3D2CBB032E7B4B80F45D', 0, '<p>La informaci&oacute;n I es suficiente</p>\n', x'5AFA3D2CBB032E7B4B80F45C', 0, '<p>La informaci&oacute;n II es suficiente</p>\n', x'5AFA3D2CBB032E7B4B80F45B', 0, '<p>Es necesario usar ambas informaciones</p>\n', x'5AFA3D2CBB032E7B4B80F45A', 0, '<p>Cada una de las informaciones por separado, es suficiente</p>\n', x'5AFA3D2CBB032E7B4B80F459', 1, '<p>Las informaciones dadas son insuficientes</p>\n', x'5AF65B00DADE1B4EE775BEFA', 'RU');
