    VALUES
        (0, x'5AFA3D81BB032E7B4B80F45E', '2018-05-14 14:39:00.172000', '<p>Calcule la altura h relativa a la hipotenusa</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:76px; width:164px" /></p>\r\n\r\n<p>Informaci&oacute;n brindada.</p>\r\n\r\n<p>I. a = 15&deg;</p>\r\n\r\n<p>II. (b + c)2 = 16 + 2bc</p>\r\n\r\n<p>Para resolver el problema:</p>\r\n', 'A', 1, x'5AFA3D81BB032E7B4B80F463', 0, '<p>La informaci&oacute;n I es suficiente</p>\n', x'5AFA3D81BB032E7B4B80F462', 0, '<p>La informaci&oacute;n II es suficiente</p>\n', x'5AFA3D81BB032E7B4B80F461', 1, '<p>Es necesario conocer las dos informaciones</p>\n', x'5AFA3D81BB032E7B4B80F460', 0, '<p>Cada una de las informaciones es suficiente</p>\n', x'5AFA3D81BB032E7B4B80F45F', 0, '<p>Las informaciones dadas son insuficientes</p>\n', x'5AF65B00DADE1B4EE775BEFA', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFA3DEDBB032E7B4B80F464', '2018-05-14 14:39:00.172000', '<p>Despu&eacute;s de analizar la siguiente figura:&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:146px; width:144px" /></p>\r\n\r\n<p>Determine las proposiciones correctas.</p>\r\n\r\n<p>I. El &aacute;rea del c&iacute;rculo de di&aacute;metro AC es igual al doble que el &aacute;rea del c&iacute;rculo de di&aacute;metro BC.</p>\r\n\r\n<p>II. El radio AO es menor al di&aacute;metro BC.</p>\r\n\r\n<p>III. El per&iacute;metro del c&iacute;rculo de di&aacute;metro AC es menor al doble del per&iacute;metro del c&iacute;rculo de di&aacute;metro BC.</p>\r\n', 'A', 1, x'5AFA3DEDBB032E7B4B80F469', 0, '<p>Solo I</p>\n', x'5AFA3DEDBB032E7B4B80F468', 0, '<p>Solo II</p>\n', x'5AFA3DEDBB032E7B4B80F467', 0, '<p>Solo III</p>\n', x'5AFA3DEDBB032E7B4B80F466', 0, '<p>II y III</p>\n', x'5AFA3DEDBB032E7B4B80F465', 1, '<p>I, II y III</p>\n', x'5AF65B00DADE1B4EE775BEFA', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFA3E51BB032E7B4B80F46A', '2018-05-14 14:39:00.172000', '<p>Cinco personas est&aacute;n sentadas en una fila: Alicia, Beto, Celia, David y Elena. Se desea saber qui&eacute;n se sienta al lado de Beto.</p>\r\n\r\n<p>Informaci&oacute;n brindada.</p>\r\n\r\n<p>I. Alicia est&aacute; primera en la fila y ninguna mujer se sienta al lado de otra mujer.</p>\r\n\r\n<p>II. David est&aacute; sentado junto a Alicia.</p>\r\n', 'A', 1, x'5AFA3E51BB032E7B4B80F46F', 0, '<p>La informaci&oacute;n I es suficiente</p>\n', x'5AFA3E51BB032E7B4B80F46E', 0, '<p>La informaci&oacute;n II es suficiente</p>\n', x'5AFA3E51BB032E7B4B80F46D', 1, '<p>Es necesario usar ambas informaciones</p>\n', x'5AFA3E51BB032E7B4B80F46C', 0, '<p>Cada informaci&oacute;n por separado, es suficiente</p>\n', x'5AFA3E51BB032E7B4B80F46B', 0, '<p>Las informaciones dadas son insuficientes</p>\n', x'5AF65AF6DADE1B4EE775BEF9', 'RU');
