    VALUES
        (0, x'5AFA40E3BB032E7B4B80F470', '2018-05-14 14:39:00.172000', '<p>Tres perros consumen juntos diariamente 800 gr de pollo, siendo la cantidad que consumen cada uno proporcional a sus pesos que son 8, 20 y 22 Kg respectivamente. Luego de un alza en el precio del pollo se decide que el perro peque&ntilde;o dejar&aacute; de comer pollo pues as&iacute; se gastar&aacute; lo mismo que antes del alza. &iquest;Cu&aacute;nto costaba el kilo del pollo antes del alza?</p>\r\n\r\n<p>Informaci&oacute;n brindada.</p>\r\n\r\n<p>I. El pollo aument&oacute; en un 33%.</p>\r\n\r\n<p>II. Antes del alza se invert&iacute;a en el perro peque&ntilde;o 16% del total.</p>\r\n\r\n<p>Para resolver el problema:</p>\r\n', 'A', 1, x'5AFA40E3BB032E7B4B80F475', 0, '<p>La informaci&oacute;n I es suficiente</p>\n', x'5AFA40E3BB032E7B4B80F474', 0, '<p>La informaci&oacute;n II es suficiente</p>\n', x'5AFA40E3BB032E7B4B80F473', 0, '<p>Es necesario usar ambas informaciones</p>\n', x'5AFA40E3BB032E7B4B80F472', 0, '<p>Cada una de las informaciones por separado, es suficiente</p>\n', x'5AFA40E3BB032E7B4B80F471', 1, '<p>Las informaciones dadas son insuficientes</p>\n', x'5AF65AF6DADE1B4EE775BEF9', 'RU');
