        (0, x'5AFA4162BB032E7B4B80F476', '2018-05-14 14:39:00.172000', '<p>Determine el n&uacute;mero de horas que se demoran 10 obreros en hacer una tarea. Si se sabe que 5 obreros lo realizan en 3 d&iacute;as.</p>\r\n\r\n<p>Informaci&oacute;n brindada.</p>\r\n\r\n<p>I. Los obreros trabajan 8 h/ d&iacute;a.</p>\r\n\r\n<p>II. Los 5 obreros trabajando 4 h/ d&iacute;a, realizan la tarea en 6 d&iacute;as.</p>\r\n\r\n<p>Para resolver el problema:</p>\r\n', 'A', 1, x'5AFA4162BB032E7B4B80F47B', 0, '<p>La informaci&oacute;n I es suficiente</p>\n', x'5AFA4162BB032E7B4B80F47A', 0, '<p>La informaci&oacute;n II es suficiente</p>\n', x'5AFA4162BB032E7B4B80F479', 0, '<p>Es necesario usar ambas informaciones a la vez</p>\n', x'5AFA4162BB032E7B4B80F478', 1, '<p>Cada una de las informaciones por separado, es suficiente</p>\n', x'5AFA4162BB032E7B4B80F477', 0, '<p>La informaci&oacute;n brindada es insuficiente</p>\n', x'5AF65AF6DADE1B4EE775BEF9', 'RU');
