        (0, x'5AFA41F4BB032E7B4B80F47C', '2018-05-14 14:39:00.172000', '<p>En un juego, los puntajes son n&uacute;meros enteros. Una persona juega 3 partidos con un promedio de 114 puntos. Luego juega 2 partidos m&aacute;s donde obtiene el mismo puntaje en cada uno. Si el promedio de los cinco partidos es 120 puntos &iquest;Cu&aacute;l es el puntaje obtenido en el partido 4 &oacute; 5?</p>\r\n', 'A', 1, x'5AFA41F4BB032E7B4B80F481', 0, '<p>120</p>\n', x'5AFA41F4BB032E7B4B80F480', 0, '<p>121</p>\n', x'5AFA41F4BB032E7B4B80F47F', 0, '<p>123</p>\n', x'5AFA41F4BB032E7B4B80F47E', 0, '<p>127</p>\n', x'5AFA41F4BB032E7B4B80F47D', 1, '<p>129</p>\n', x'5AF65B2CDADE1B4EE775BEFD', 'RU');
