        (0, x'5AFA436BBB032E7B4B80F482', '2018-05-14 14:39:00.172000', '<p>El menor n&uacute;mero x que tiene 12 divisores exactos, incluyendo 1 y x puede ser hallado en el intervalo.</p>\r\n', 'A', 1, x'5AFA436BBB032E7B4B80F487', 0, '<p><img src="data:image/png;base64," style="height:20px; width:88px" /></p>\n', x'5AFA436BBB032E7B4B80F486', 1, '<p><img src="data:image/png;base64," style="height:24px; width:81px" /></p>\n', x'5AFA436BBB032E7B4B80F485', 0, '<p><img src="data:image/png;base64," style="height:18px; width:70px" /></p>\n', x'5AFA436BBB032E7B4B80F484', 0, '<p><img src="data:image/png;base64," style="height:20px; width:75px" /></p>\n', x'5AFA436BBB032E7B4B80F483', 0, '<p><img src="data:image/png;base64," style="height:26px; width:78px" /></p>\n', x'5AF65B49DADE1B4EE775BF00', 'RU');
