        (0, x'5AFA43B4BB032E7B4B80F488', '2018-05-14 14:39:00.172000', '<p>Determine el producto de a, b y c; si se sabe que:</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:79px; width:115px" /></p>\r\n', 'A', 1, x'5AFA43B4BB032E7B4B80F48D', 0, '<p>&nbsp;225</p>\n', x'5AFA43B4BB032E7B4B80F48C', 1, '<p>270</p>\n', x'5AFA43B4BB032E7B4B80F48B', 0, '<p>666</p>\n', x'5AFA43B4BB032E7B4B80F48A', 0, '<p>686</p>\n', x'5AFA43B4BB032E7B4B80F489', 0, '<p>1350</p>\n', x'5AF65B51DADE1B4EE775BF01', 'RU');
