    VALUES
        (0, x'5AFA441ABB032E7B4B80F48E', '2018-05-14 14:39:00.172000', '<p>Se tiene 3 urnas, la primera contiene 4 bolas blancas y 2 negras, la segunda 3 blancas y 3 negras y la tercera, 3 blancas y 6 negras. Se elige una urna al azar y se extrae una bola. Calcule la probabilidad de que la bola extra&iacute;da sea negra.</p>\r\n', 'A', 1, x'5AFA441ABB032E7B4B80F493', 1, '<p>1/2</p>\n', x'5AFA441ABB032E7B4B80F492', 0, '<p>5/9</p>\n', x'5AFA441ABB032E7B4B80F491', 0, '<p>11/18</p>\n', x'5AFA441ABB032E7B4B80F490', 0, '<p>2/3</p>\n', x'5AFA441ABB032E7B4B80F48F', 0, '<p>13/18</p>\n', x'5AF65CA1DADE1B4EE775BF16', 'RU');
