        (0, x'5AFCCDC6E4720305E3DEAA7B', '2018-05-15 13:36:53.284000', '<p>Se definen los operadores:</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:197px; width:222px" /></p>\r\n', 'A', 1, x'5AFCCDC6E4720305E3DEAA80', 0, '<p>5</p>\n\n<p>&nbsp;</p>\n', x'5AFCCDC6E4720305E3DEAA7F', 0, '<p>6</p>\n', x'5AFCCDC6E4720305E3DEAA7E', 1, '<p>10</p>\n', x'5AFCCDC6E4720305E3DEAA7D', 0, '<p>15</p>\n', x'5AFCCDC6E4720305E3DEAA7C', 0, '<p>30</p>\n', x'5AF65D5DDADE1B4EE775BF1F', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCCE1AE4720305E3DEAA81', '2018-05-15 13:36:53.284000', '<p>Los resultados de una investigaci&oacute;n de los a&ntilde;os 2011 y 2014 se muestran en el siguiente gr&aacute;fico:</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:158px; width:221px" /></p>\r\n\r\n<p>De las siguientes afirmaciones &iquest;cu&aacute;les son verdaderas?</p>\r\n\r\n<p>I. En todo tiempo la poblaci&oacute;n lee m&aacute;s por placer.</p>\r\n\r\n<p>II. En promedio, por cualquier motivo se le&iacute;a m&aacute;s en el 2011.</p>\r\n\r\n<p>III. Los lectores con 2 motivos diferentes han disminuido, del 2011 al 2014 en la misma proporci&oacute;n.</p>\r\n', 'A', 1, x'5AFCCE1AE4720305E3DEAA86', 0, '<p>Solo I</p>\n', x'5AFCCE1AE4720305E3DEAA85', 1, '<p>Solo II</p>\n', x'5AFCCE1AE4720305E3DEAA84', 0, '<p>Solo III</p>\n', x'5AFCCE1AE4720305E3DEAA83', 0, '<p>I y II</p>\n', x'5AFCCE1AE4720305E3DEAA82', 0, '<p>II y III</p>\n', x'5AF65DB2DADE1B4EE775BF26', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCCE5FE4720305E3DEAA87', '2018-05-15 13:36:53.284000', '<p>Los datos de la tabla se refieren al desembarque de productos pesqueros para el consumo humano en miles de TMB durante dos a&ntilde;os.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:75px; width:231px" /></p>\r\n\r\n<p>&iquest;En cu&aacute;ntos puntos porcentuales se increment&oacute; el desembarque de productos pesqueros de un a&ntilde;o a otro?</p>\r\n', 'A', 1, x'5AFCCE5FE4720305E3DEAA8C', 1, '<p>3,3 %</p>\n', x'5AFCCE5FE4720305E3DEAA8B', 0, '<p>4,3 %</p>\n', x'5AFCCE5FE4720305E3DEAA8A', 0, '<p>6,1 %</p>\n', x'5AFCCE5FE4720305E3DEAA89', 0, '<p>17 %</p>\n', x'5AFCCE5FE4720305E3DEAA88', 0, '<p>21 %</p>\n', x'5AF65DBCDADE1B4EE775BF27', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCCEA1E4720305E3DEAA8D', '2018-05-15 13:36:53.284000', '<p>La siguiente tabla de frecuencia consigna el n&uacute;mero de llamadas telef&oacute;nicas diarias realizadas y su frecuencia (fi), durante el mes de abril del 2013 desde un convento de clausura.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:173px; width:201px" /></p>\r\n\r\n<p>De acuerdo con esta informaci&oacute;n se concluye que:</p>\r\n', 'A', 1, x'5AFCCEA1E4720305E3DEAA92', 1, '<p>En un 23,3 % de los d&iacute;as del mes, se realizaron 4 llamadas diarias</p>\n', x'5AFCCEA1E4720305E3DEAA91', 0, '<p>En un 76,6 % de los d&iacute;as del mes, se realizaron m&aacute;s de 5 llamadas diarias</p>\n', x'5AFCCEA1E4720305E3DEAA90', 0, '<p>En 23 d&iacute;as del mes, se realizaron menos de 3 llamadas diarias</p>\n', x'5AFCCEA1E4720305E3DEAA8F', 0, '<p>En 5 d&iacute;as del mes, se realizaron 4 llamadas diarias</p>\n', x'5AFCCEA1E4720305E3DEAA8E', 0, '<p>En un 53,3 % de los d&iacute;as del mes, se realizaron 2 llamadas diarias</p>\n', x'5AF65DBCDADE1B4EE775BF27', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCCEE5E4720305E3DEAA93', '2018-05-15 13:36:53.284000', '<p>Con la informaci&oacute;n brindada, determine la veracidad de las siguientes proposiciones:</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:115px; width:222px" /></p>\r\n\r\n<p>I. Las exportaciones en miner&iacute;a son m&aacute;s de 4 veces las exportaciones de gas y petr&oacute;leo.</p>\r\n\r\n<p>II. Las exportaciones agropecuarias representan aproximadamente el 5,5% de las exportaciones del pa&iacute;s.</p>\r\n\r\n<p>III. Las exportaciones agropecuarias son el 49% de las exportaciones de gas y petr&oacute;leo.</p>\r\n', 'A', 1, x'5AFCCEE5E4720305E3DEAA98', 0, '<p>Solo I</p>\n', x'5AFCCEE5E4720305E3DEAA97', 1, '<p>Solo II</p>\n', x'5AFCCEE5E4720305E3DEAA96', 0, '<p>Solo III</p>\n', x'5AFCCEE5E4720305E3DEAA95', 0, '<p>I y II</p>\n', x'5AFCCEE5E4720305E3DEAA94', 0, '<p>II y III</p>\n', x'5AF65DAADADE1B4EE775BF25', 'RU');
