        (0, x'5AFCD103E4720305E3DEAA99', '2018-05-15 13:36:53.284000', '<p>Si se cumple</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:30px; width:217px" /></p>\r\n\r\n<p>determine el valor de a + b + c.</p>\r\n', 'A', 1, x'5AFCD103E4720305E3DEAA9E', 0, '<p>8</p>\n', x'5AFCD103E4720305E3DEAA9D', 1, '<p>11</p>\n', x'5AFCD103E4720305E3DEAA9C', 0, '<p>15</p>\n', x'5AFCD103E4720305E3DEAA9B', 0, '<p>19</p>\n', x'5AFCD103E4720305E3DEAA9A', 0, '<p>22</p>\n', x'5AF66320DADE1B4EE775BF67', 'RU');
