        (0, x'5AFCD138E4720305E3DEAA9F', '2018-05-15 13:36:53.284000', '<p>Si a la suma de 35 n&uacute;meros impares consecutivos se le resta 42, entonces la cifra de la unidad del resultado final es:</p>\r\n', 'A', 1, x'5AFCD138E4720305E3DEAAA4', 0, '<p>1</p>\n', x'5AFCD138E4720305E3DEAAA3', 1, '<p>3</p>\n', x'5AFCD138E4720305E3DEAAA2', 0, '<p>5</p>\n', x'5AFCD138E4720305E3DEAAA1', 0, '<p>7</p>\n', x'5AFCD138E4720305E3DEAAA0', 0, '<p>9</p>\n', x'5AF66352DADE1B4EE775BF6B', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCD191E4720305E3DEAAA5', '2018-05-15 13:36:53.284000', '<p>Sea N un n&uacute;mero formado por tres cifras pares. Si N + 1 es m&uacute;ltiplo de 7 y N + 2 es m&uacute;ltiplo de 8, entonces la suma de las cifras de N es:</p>\r\n', 'A', 1, x'5AFCD191E4720305E3DEAAAA', 0, '<p>6</p>\n', x'5AFCD191E4720305E3DEAAA9', 0, '<p>9</p>\n', x'5AFCD191E4720305E3DEAAA8', 0, '<p>12</p>\n', x'5AFCD191E4720305E3DEAAA7', 1, '<p>18</p>\n', x'5AFCD191E4720305E3DEAAA6', 0, '<p>21</p>\n', x'5AF663F4DADE1B4EE775BF77', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCD1DDE4720305E3DEAAAB', '2018-05-15 13:36:53.284000', '<p>Sean A y B enteros positivos tales que A &gt; B. Al dividir A entre B se obtiene rd residuo por defecto y re residuo por exceso. Indique la alternativa correcta despu&eacute;s de determinar si cada proposici&oacute;n es verdadera (V) o falsa (F).</p>\r\n\r\n<p>I. rd + re = A</p>\r\n\r\n<p>II. re &gt; rd</p>\r\n\r\n<p>III. MCD (A;B) = MCD (rd, re)</p>\r\n', 'A', 1, x'5AFCD1DDE4720305E3DEAAB0', 0, '<p>F F F</p>\n', x'5AFCD1DDE4720305E3DEAAAF', 0, '<p>F V V</p>\n', x'5AFCD1DDE4720305E3DEAAAE', 1, '<p>F F V</p>\n', x'5AFCD1DDE4720305E3DEAAAD', 0, '<p>F V F</p>\n', x'5AFCD1DDE4720305E3DEAAAC', 0, '<p>V V V</p>\n', x'5AF6639CDADE1B4EE775BF71', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCD220E4720305E3DEAAB1', '2018-05-15 13:36:53.284000', '<p>Se&ntilde;ale, la alternativa que presenta la secuencia correcta despu&eacute;s de determinar si la proposici&oacute;n es verdadera (V) o falsa (F):</p>\r\n\r\n<p>I. Si a &gt; 0, entonces existe n0 &Icirc; N tal que a &gt;&nbsp; 1/n0</p>\r\n\r\n<p>II. Para cada a, b &Icirc; Q con a &lt; b, existe c &Iuml; Q tal que a &lt; c &lt; b.</p>\r\n\r\n<p>III. Todo n&uacute;mero irracional puede ser aproximado por n&uacute;meros racionales.</p>\r\n', 'A', 1, x'5AFCD220E4720305E3DEAAB6', 1, '<p>V V V</p>\n', x'5AFCD220E4720305E3DEAAB5', 0, '<p>V F F</p>\n', x'5AFCD220E4720305E3DEAAB4', 0, '<p>F V V</p>\n', x'5AFCD220E4720305E3DEAAB3', 0, '<p>F F V</p>\n', x'5AFCD220E4720305E3DEAAB2', 0, '<p>F F F</p>\n', x'5AF6651DDADE1B4EE775BF8E', 'RU');
