        (0, x'5AFCD2E7E4720305E3DEAABD', '2018-05-15 13:36:53.284000', '<p>Se escogi&oacute; un sal&oacute;n de clases de sexto grado con un total de 25 estudiantes y se les pidi&oacute; a cada estudiante que evaluara un programa televisivo con una calificaci&oacute;n de 1 a 5. (5 = excelente, 4 = bueno, 3 = regular, 2 = malo, 1 = fatal)</p>\r\n\r\n<p>Los resultados se muestran en la siguiente tabla.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:116px; width:201px" /></p>\r\n\r\n<p>Calcule la suma de la media, la moda y la mediana de las calificaciones.</p>\r\n', 'A', 1, x'5AFCD2E7E4720305E3DEAAC2', 0, '<p>1,00</p>\n', x'5AFCD2E7E4720305E3DEAAC1', 0, '<p>4,72</p>\n', x'5AFCD2E7E4720305E3DEAAC0', 1, '<p>&nbsp;5,72</p>\n', x'5AFCD2E7E4720305E3DEAABF', 0, '<p>6,72</p>\n', x'5AFCD2E7E4720305E3DEAABE', 0, '<p>8,72</p>\n', x'5AF6621DDADE1B4EE775BF59', 'RU');
