        (0, x'5AFCD4F1E4720305E3DEAAD5', '2018-05-15 13:36:53.284000', '<p>Si a + b + c = 1 y a3 + b3 + c3 = 4, entonces el valor de</p>\r\n\r\n<p>&nbsp;<img src="data:image/png;base64," style="height:37px; width:189px" /></p>\r\n', 'A', 1, x'5AFCD4F1E4720305E3DEAADA', 1, '<p>- 2</p>\n', x'5AFCD4F1E4720305E3DEAAD9', 0, '<p>- 1</p>\n', x'5AFCD4F1E4720305E3DEAAD8', 0, '<p>0</p>\n', x'5AFCD4F1E4720305E3DEAAD7', 0, '<p>1</p>\n', x'5AFCD4F1E4720305E3DEAAD6', 0, '<p>2</p>\n', x'5AF6671BDADE1B4EE775BFAD', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCD537E4720305E3DEAADB', '2018-05-15 13:36:53.284000', '<p>. Al dividir un polinomio P = P(x) de grado 3 entre (x + 2) se obtiene un polinomio cociente Q = Q(x) y un resto de grado 1, si se sabe que P(0) = &ndash; 1, P( &ndash; 2) = &ndash; 5 y Q(0) = 1.</p>\r\n\r\n<p>&nbsp;Halle la expresi&oacute;n del resto</p>\r\n', 'A', 1, x'5AFCD537E4720305E3DEAAE0', 0, '<p>x + 3</p>\n', x'5AFCD537E4720305E3DEAADF', 0, '<p>x + 1</p>\n', x'5AFCD537E4720305E3DEAADE', 0, '<p>x &ndash; 1</p>\n', x'5AFCD537E4720305E3DEAADD', 1, '<p>x &ndash; 3</p>\n', x'5AFCD537E4720305E3DEAADC', 0, '<p>2x &ndash; 1</p>\n', x'5AF666BADADE1B4EE775BFAA', 'RU');
