    VALUES
        (0, x'5AFCD66AE4720305E3DEAAE1', '2018-05-15 13:36:53.284000', '<p>Sea x tal que |x| &lt; 1. Calcule en funci&oacute;n de x, el valor de la suma: S = 2 + 4x + 6x2 + 8x3 + 10x4 + &hellip;.</p>\r\n', 'A', 1, x'5AFCD66AE4720305E3DEAAE6', 0, '<p><img src="data:image/png;base64," style="height:39px; width:37px" /></p>\n', x'5AFCD66AE4720305E3DEAAE5', 0, '<p><img src="data:image/png;base64," style="height:34px; width:38px" /></p>\n', x'5AFCD66AE4720305E3DEAAE4', 1, '<p><img src="data:image/png;base64," style="height:38px; width:63px" /></p>\n', x'5AFCD66AE4720305E3DEAAE3', 0, '<p><img src="data:image/png;base64," style="height:41px; width:66px" /></p>\n', x'5AFCD66AE4720305E3DEAAE2', 0, '<p><img src="data:image/png;base64," style="height:37px; width:64px" /></p>\n', x'5AF666BADADE1B4EE775BFAA', 'RU');
