        (0, x'5AFCD92BE4720305E3DEAB53', '2018-05-15 13:36:53.284000', '<p>El punto (- 1; - 2) pertenece a la gr&aacute;fica de la funci&oacute;n polin&oacute;mica f(x) = 2kx3 + 4kx2 &ndash; 3x &ndash; 9.&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:39px; width:160px" /></p>\r\n\r\n<p>&iquest;Cu&aacute;l de las siguientes gr&aacute;ficas corresponde a g para x &gt; 0?</p>\r\n', 'A', 1, x'5AFCD92BE4720305E3DEAB58', 0, '<p><img src="data:image/png;base64," style="height:85px; width:75px" /></p>\n', x'5AFCD92BE4720305E3DEAB57', 0, '<p><img src="data:image/png;base64," style="height:83px; width:84px" /></p>\n', x'5AFCD92BE4720305E3DEAB56', 1, '<p><img src="data:image/png;base64," style="height:88px; width:81px" /></p>\n', x'5AFCD92BE4720305E3DEAB55', 0, '<p><img src="data:image/png;base64," style="height:99px; width:80px" /></p>\n', x'5AFCD92BE4720305E3DEAB54', 0, '<p><img src="data:image/png;base64," style="height:99px; width:101px" /></p>\n', x'5AF66B36DADE1B4EE775BFF1', 'RU');
