        (0, x'5AFCDA77E4720305E3DEAB59', '2018-05-15 13:36:53.284000', '<p>Sea f la funci&oacute;n definida por:</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:62px; width:201px" /></p>\r\n', 'A', 1, x'5AFCDA77E4720305E3DEAB5E', 0, '<p><img src="data:image/png;base64," style="height:31px; width:133px" /></p>\n', x'5AFCDA77E4720305E3DEAB5D', 0, '<p><img src="data:image/png;base64," style="height:35px; width:136px" /></p>\n', x'5AFCDA77E4720305E3DEAB5C', 0, '<p><img src="data:image/png;base64," style="height:31px; width:128px" /></p>\n', x'5AFCDA77E4720305E3DEAB5B', 0, '<p><img src="data:image/png;base64," style="height:36px; width:130px" /></p>\n', x'5AFCDA77E4720305E3DEAB5A', 1, '<p><img src="data:image/png;base64," style="height:31px; width:124px" /></p>\n', x'5AF66B03DADE1B4EE775BFEE', 'RU');
