    VALUES
        (0, x'5AFCDBD6E4720305E3DEAB5F', '2018-05-15 13:36:53.284000', '<p>Sea A una matriz de orden 3 x 5 y B una submatriz cuadrada A de orden 3 tal que A = (B : N) donde N es de orden 3 x 2 y B-1 existe. Correspondientemente, en el sistema Ax = b, x se descompone como</p>\r\n\r\n<p><strong><img src="data:image/png;base64," style="height:58px; width:205px" /></strong></p>\r\n', 'A', 1, x'5AFCDBD6E4720305E3DEAB64', 0, '<p><strong><img src="data:image/png;base64," style="height:51px; width:49px" /></strong></p>\n', x'5AFCDBD6E4720305E3DEAB63', 0, '<p><strong><img src="data:image/png;base64," style="height:56px; width:46px" /></strong></p>\n', x'5AFCDBD6E4720305E3DEAB62', 0, '<p><strong><img src="data:image/png;base64," style="height:44px; width:33px" /></strong></p>\n', x'5AFCDBD6E4720305E3DEAB61', 1, '<p><strong><img src="data:image/png;base64," style="height:51px; width:43px" /></strong></p>\n', x'5AFCDBD6E4720305E3DEAB60', 0, '<p><img src="data:image/png;base64," style="height:46px; width:59px" /></p>\n', x'5AF66DB8DADE1B4EE775C01B', 'RU');
