        (0, x'5AFCDD34E4720305E3DEAB65', '2018-05-15 13:36:53.284000', '<p>Sea:</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:27px; width:243px" /></p>\r\n\r\n<p>Si a &lt; 0 y b &gt; 0, determine la soluci&oacute;n del problema</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:42px; width:102px" /></p>\r\n', 'A', 1, x'5AFCDD34E4720305E3DEAB6A', 0, '<p>(0; 0)</p>\n', x'5AFCDD34E4720305E3DEAB69', 0, '<p>(0; 2)</p>\n', x'5AFCDD34E4720305E3DEAB68', 1, '<p>(0; 4)</p>\n', x'5AFCDD34E4720305E3DEAB67', 0, '<p>(2; 0)</p>\n', x'5AFCDD34E4720305E3DEAB66', 0, '<p>(4; 0)</p>\n', x'5AF66E45DADE1B4EE775C024', 'RU');
