        (0, x'5AFCDDD2E4720305E3DEAB71', '2018-05-15 13:36:53.284000', '<p>Tres n&uacute;meros x, y, z forman una progresi&oacute;n geom&eacute;trica creciente que cumplen:</p>\r\n\r\n<p>&nbsp;x + y + z = 21,</p>\r\n\r\n<p>x . y . z = 216.</p>\r\n\r\n<p>Determine la raz&oacute;n de la progresi&oacute;n dada.</p>\r\n', 'A', 1, x'5AFCDDD2E4720305E3DEAB76', 0, '<p>3/2</p>\n', x'5AFCDDD2E4720305E3DEAB75', 1, '<p>2</p>\n', x'5AFCDDD2E4720305E3DEAB74', 0, '<p>5/2</p>\n', x'5AFCDDD2E4720305E3DEAB73', 0, '<p>3</p>\n', x'5AFCDDD2E4720305E3DEAB72', 0, '<p>7/3</p>\n', x'5AF66F28DADE1B4EE775C031', 'RU');
