        (0, x'5AFCE0A8E4720305E3DEAB95', '2018-05-15 13:36:53.284000', '<p>Se consideran un cuadrado ABCD y un tri&aacute;ngulo equil&aacute;tero ABE con E encima del plano del cuadrado. Halle el &aacute;ngulo formado por el tri&aacute;ngulo ABE y el cuadrado ABCD, si las &aacute;reas de los tri&aacute;ngulos AEB y DCE est&aacute;n en la relaci&oacute;n <em>3</em><img src="data:image/png;base64," style="height:20px; width:16px" />&nbsp;.</p>\r\n', 'A', 1, x'5AFCE0A8E4720305E3DEAB9A', 0, '<p>15&deg;</p>\n', x'5AFCE0A8E4720305E3DEAB99', 0, '<p>22&deg; 30&#39;</p>\n', x'5AFCE0A8E4720305E3DEAB98', 1, '<p>30&deg;</p>\n', x'5AFCE0A8E4720305E3DEAB97', 0, '<p>37&deg;</p>\n', x'5AFCE0A8E4720305E3DEAB96', 0, '<p>60&deg;</p>\n', x'5AF7856CDADE1B4EE775C0AB', 'RU');
