INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFCEA26E4720305E3DEABCB', '2018-05-15 13:36:53.284000', '<p>Dados</p>\r\n\r\n<p>P = tan (400&deg;) + cos (810&deg;),</p>\r\n\r\n<p>Q = cot (760&deg;) . sen (450&deg;),</p>\r\n\r\n<p>R = tan (1125&deg;) . sec (720&deg;),</p>\r\n\r\n<p>Indique la alternativa correcta:</p>\r\n', 'A', 1, x'5AFCEA26E4720305E3DEABD0', 0, '<p>P &gt; Q &gt; R</p>\n', x'5AFCEA26E4720305E3DEABCF', 0, '<p>P &gt; R &gt; Q</p>\n', x'5AFCEA26E4720305E3DEABCE', 0, '<p>Q &gt; P &gt; R</p>\n', x'5AFCEA26E4720305E3DEABCD', 1, '<p>Q &gt; R &gt; P</p>\n', x'5AFCEA26E4720305E3DEABCC', 0, '<p>P = Q = R</p>\n', x'5AF78D7ADADE1B4EE775C123', 'RU');
