        (0, x'5AFCECF5E4720305E3DEABE9', '2018-05-15 13:36:53.284000', '<p>Determine las coordenadas del foco de coordenadas positivas de la elipse 4x2 + y2 - 8x + 4y = 8.</p>\r\n', 'A', 1, x'5AFCECF5E4720305E3DEABEE', 0, '<p><img src="data:image/png;base64," style="height:26px; width:98px" /></p>\n', x'5AFCECF5E4720305E3DEABED', 1, '<p><img src="data:image/png;base64," style="height:28px; width:100px" /></p>\n', x'5AFCECF5E4720305E3DEABEC', 0, '<p><img src="data:image/png;base64," style="height:23px; width:84px" /></p>\n', x'5AFCECF5E4720305E3DEABEB', 0, '<p><img src="data:image/png;base64," style="height:30px; width:84px" /></p>\n', x'5AFCECF5E4720305E3DEABEA', 0, '<p><img src="data:image/png;base64," style="height:24px; width:86px" /></p>\n', x'5AF791C4DADE1B4EE775C179', 'RU');
