INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD4D8FE4720305E3DEABFB', '2018-05-15 13:36:53.284000', '<p>. Se suelta una piedra desde una altura H = 20,4 m llegando al suelo en un tiempo t. Calcule aproximadamente con qu&eacute; rapidez, en m/s, hacia abajo, debe lanzarse la misma piedra para que llegue al suelo desde la misma altura en un tiempo t/2.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:26px; width:116px" /></p>\r\n', 'A', 1, x'5AFD4D8FE4720305E3DEAC00', 0, '<p>10</p>\n', x'5AFD4D8FE4720305E3DEABFF', 0, '<p>12</p>\n', x'5AFD4D8FE4720305E3DEABFE', 0, '<p>14</p>\n', x'5AFD4D8FE4720305E3DEABFD', 1, '<p>15</p>\n', x'5AFD4D8FE4720305E3DEABFC', 0, '<p>19</p>\n', x'5AF79625DADE1B4EE775C191', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD4DE8E4720305E3DEAC01', '2018-05-15 13:36:53.284000', '<p>Dos ciudades situadas en las m&aacute;rgenes de un rio, se encuentran separadas 100 km. Un bote que hace el recorrido entre ellas tarda 5h cuando va rio arriba y 4h cuando va rio abajo. Si la rapidez de la corriente es la misma en ambos casos, calcule esta rapidez en km/h.</p>\r\n', 'A', 1, x'5AFD4DE8E4720305E3DEAC06', 0, '<p>0,5</p>\n', x'5AFD4DE8E4720305E3DEAC05', 0, '<p>1,5</p>\n', x'5AFD4DE8E4720305E3DEAC04', 1, '<p>2,5</p>\n', x'5AFD4DE8E4720305E3DEAC03', 0, '<p>3,5</p>\n\n<p>&nbsp;</p>\n', x'5AFD4DE8E4720305E3DEAC02', 0, '<p>4,5</p>\n', x'5AF795BADADE1B4EE775C189', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD4E3EE4720305E3DEAC07', '2018-05-15 13:36:53.284000', '<p>En la figura mostrada, cada uno de los resortes tiene constante el&aacute;stica k = 250 N/m y longitud normal de 0,5 m. Si la masa del bloque es m = 75 kg calcule la fuerza de fricci&oacute;n, en N, que act&uacute;a sobre el bloque que se encuentra en reposo.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:67px; width:219px" /></p>\r\n', 'A', 1, x'5AFD4E3EE4720305E3DEAC0C', 0, '<p>110</p>\n', x'5AFD4E3EE4720305E3DEAC0B', 0, '<p>115</p>\n', x'5AFD4E3EE4720305E3DEAC0A', 0, '<p>120</p>\n', x'5AFD4E3EE4720305E3DEAC09', 1, '<p>125</p>\n', x'5AFD4E3EE4720305E3DEAC08', 0, '<p>130</p>\n', x'5AF79BCEDADE1B4EE775C19F', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD4E86E4720305E3DEAC0D', '2018-05-15 13:36:53.284000', '<p>Un escritor de ciencia ficci&oacute;n especula que la Tierra tiene un segundo sat&eacute;lite natural de igual masa que la Luna (Luna 2) y cuya &oacute;rbita tiene un radio igual a la mitad del radio de la &oacute;rbita de la Luna.</p>\r\n\r\n<p>Considerando que la Luna tiene un per&iacute;odo de 28 d&iacute;as y que las lunas no interact&uacute;an, halle aproximadamente el per&iacute;odo de la Luna 2 (en d&iacute;as).</p>\r\n', 'A', 1, x'5AFD4E86E4720305E3DEAC12', 0, '<p>4,2</p>\n', x'5AFD4E86E4720305E3DEAC11', 0, '<p>5,6</p>\n', x'5AFD4E86E4720305E3DEAC10', 0, '<p>8,4</p>\n', x'5AFD4E86E4720305E3DEAC0F', 1, '<p>9,9</p>\n', x'5AFD4E86E4720305E3DEAC0E', 0, '<p>12,6</p>\n', x'5AF7965CDADE1B4EE775C196', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD4EEBE4720305E3DEAC13', '2018-05-15 13:36:53.284000', '<p>Al tratar de detener su auto en una calle un conductor pisa el pedal del freno demasiado fuerte y el auto comienza a resbalar por un camino recto, recorriendo en total 30 m antes de detenerse. Todas las ruedas resbalan hasta detenerse. Si la masa del auto es 1100 kg y el coeficiente de fricci&oacute;n cin&eacute;tico entre las ruedas y la pista es 0,9; calcule aproximadamente la rapidez inicial del auto en m/s.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:28px; width:124px" /></p>\r\n', 'A', 1, x'5AFD4EEBE4720305E3DEAC18', 0, '<p>13</p>\n', x'5AFD4EEBE4720305E3DEAC17', 0, '<p>18</p>\n', x'5AFD4EEBE4720305E3DEAC16', 1, '<p>23</p>\n', x'5AFD4EEBE4720305E3DEAC15', 0, '<p>25</p>\n', x'5AFD4EEBE4720305E3DEAC14', 0, '<p>26</p>\n', x'5AF79EDADADE1B4EE775C1A4', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD4F25E4720305E3DEAC19', '2018-05-15 13:36:53.284000', '<p>Un proyectil de 20 g de masa atraviesa una bolsa de arena. El proyectil ingresa a una velocidad de 20 m/s y logra salir por el otro extremo a una velocidad de 5 m/s. La fuerza de resistencia promedio de la arena es de 15 N. Encuentre la distancia, en cm, que recorre el proyectil sobre la arena.</p>\r\n', 'A', 1, x'5AFD4F25E4720305E3DEAC1E', 0, '<p>16,7</p>\n', x'5AFD4F25E4720305E3DEAC1D', 0, '<p>20,0</p>\n', x'5AFD4F25E4720305E3DEAC1C', 1, '<p>25,0</p>\n', x'5AFD4F25E4720305E3DEAC1B', 0, '<p>26,7</p>\n', x'5AFD4F25E4720305E3DEAC1A', 0, '<p>28,3</p>\n', x'5AF7A13ADADE1B4EE775C1BB', 'RU');
