        (0, x'5AFD500DE4720305E3DEAC25', '2018-05-15 13:36:53.284000', '<p>La masa de un p&eacute;ndulo simple realiza un M.A.S. de amplitud 2 m. Si esta masa tiene una rapidez m&aacute;xima de 1 m/s, la longitud del p&eacute;ndulo, en metros, es:&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:24px; width:126px" /></p>\r\n', 'A', 1, x'5AFD500DE4720305E3DEAC2A', 0, '<p>14,74</p>\n', x'5AFD500DE4720305E3DEAC29', 0, '<p>19,64</p>\n', x'5AFD500DE4720305E3DEAC28', 0, '<p>29,44</p>\n', x'5AFD500DE4720305E3DEAC27', 0, '<p>35,74</p>\n', x'5AFD500DE4720305E3DEAC26', 1, '<p>39,24</p>\n', x'5AF7A323DADE1B4EE775C1C4', 'RU');
