        (0, x'5AFD50BEE4720305E3DEAC31', '2018-05-15 13:36:53.284000', '<p>En la figura se tiene un circuito formado por alambres. Solo los tramos BCD y BD presentan resistencia el&eacute;ctrica. Ambos tramos son del mismo material y poseen la misma secci&oacute;n transversal pero diferente longitud. Si la corriente el&eacute;ctrica que circula por el tramo recto BD es 4 A, halle la corriente el&eacute;ctrica, en A, que pasa por el tramo BCD.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:133px; width:191px" /></p>\r\n', 'A', 1, x'5AFD50BEE4720305E3DEAC36', 0, '<p>0,5</p>\n', x'5AFD50BEE4720305E3DEAC35', 0, '<p>0,8</p>\n', x'5AFD50BEE4720305E3DEAC34', 1, '<p>1,2</p>\n', x'5AFD50BEE4720305E3DEAC33', 0, '<p>2,4</p>\n', x'5AFD50BEE4720305E3DEAC32', 0, '<p>3,8</p>\n', x'5AF7A6A3DADE1B4EE775C1EB', 'RU');
