        (0, x'5AFD50EDE4720305E3DEAC37', '2018-05-15 13:36:53.284000', '<p>La figura muestra un circuito el&eacute;ctrico con fuentes de fem, cuyas resistencias internas son insignificantes. Halle la corriente, en A, que circula por la resistencia de 2W.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:115px; width:181px" /></p>\r\n', 'A', 1, x'5AFD50EDE4720305E3DEAC3C', 1, '<p>0,5</p>\n', x'5AFD50EDE4720305E3DEAC3B', 0, '<p>1,2</p>\n', x'5AFD50EDE4720305E3DEAC3A', 0, '<p>1,5</p>\n', x'5AFD50EDE4720305E3DEAC39', 0, '<p>2,4</p>\n', x'5AFD50EDE4720305E3DEAC38', 0, '<p>2,8</p>\n', x'5AF7A6A3DADE1B4EE775C1EB', 'RU');
