    VALUES
        (0, x'5AFD5262E4720305E3DEAC49', '2018-05-15 13:36:53.284000', '<p>. La figura muestra un diagrama presi&oacute;n P vs. volumen V para un proceso seguido por un gas ideal. Si la energ&iacute;a interna del gas permanece constante durante todo el proceso, calcule el volumen del gas cuando la presi&oacute;n es Po/4.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:177px; width:179px" /></p>\r\n', 'A', 1, x'5AFD5262E4720305E3DEAC4E', 0, '<p>2Vo</p>\n', x'5AFD5262E4720305E3DEAC4D', 0, '<p>3,5 Vo</p>\n', x'5AFD5262E4720305E3DEAC4C', 1, '<p>4 Vo</p>\n', x'5AFD5262E4720305E3DEAC4B', 0, '<p>4,5 Vo</p>\n', x'5AFD5262E4720305E3DEAC4A', 0, '<p>5 Vo</p>\n', x'5AF7A558DADE1B4EE775C1DA', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD52ABE4720305E3DEAC4F', '2018-05-15 13:36:53.284000', '<p>Para almacenar energ&iacute;a el&eacute;ctrica se usa una bater&iacute;a de 2 000 condensadores de 10 mF cada uno, conectados en paralelo. Encuentre cu&aacute;nto cuesta aproximadamente, cargar esta bater&iacute;a hasta 50 kV, si 1 kWh cuesta S/. 0,70.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:28px; width:215px" /></p>\r\n', 'A', 1, x'5AFD52ABE4720305E3DEAC54', 1, '<p>4,86</p>\n', x'5AFD52ABE4720305E3DEAC53', 0, '<p>&nbsp;6,48</p>\n', x'5AFD52ABE4720305E3DEAC52', 0, '<p>8,46</p>\n', x'5AFD52ABE4720305E3DEAC51', 0, '<p>10,25</p>\n', x'5AFD52ABE4720305E3DEAC50', 0, '<p>12,46</p>\n', x'5AF7A633DADE1B4EE775C1E9', 'RU');
