INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD5339E4720305E3DEAC5B', '2018-05-15 13:36:53.284000', '<p>Frente a un espejo c&oacute;ncavo de distancia focal f = 40 cm se coloca un objeto, tal que la imagen obtenida es real, y se encuentra a 50 cm del espejo. Si la altura de la imagen es 25 cm, calcule la altura del objeto en metros.&nbsp;</p>\r\n', 'A', 1, x'5AFD5339E4720305E3DEAC60', 1, '<p>1,00</p>\n', x'5AFD5339E4720305E3DEAC5F', 0, '<p>1,25</p>\n', x'5AFD5339E4720305E3DEAC5E', 0, '<p>1,50</p>\n', x'5AFD5339E4720305E3DEAC5D', 0, '<p>1,75</p>\n', x'5AFD5339E4720305E3DEAC5C', 0, '<p>2,00</p>\n', x'5AF7A7CDDADE1B4EE775C1FE', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD5372E4720305E3DEAC61', '2018-05-15 13:36:53.284000', '<p>En el efecto fotoel&eacute;ctrico se establece que:</p>\r\n\r\n<p>I) La energ&iacute;a de los fotones incidentes debe ser mayor que el trabajo de extracci&oacute;n.</p>\r\n\r\n<p>II) En cualquier superficie met&aacute;lica, la energ&iacute;a requerida para producir una emisi&oacute;n de electrones es la misma.</p>\r\n\r\n<p>III) Si duplicamos la intensidad de los fotones incidentes se duplicar&aacute; la energ&iacute;a cin&eacute;tica de los electrones emitidos.</p>\r\n', 'A', 1, x'5AFD5372E4720305E3DEAC66', 0, '<p>V V V</p>\n', x'5AFD5372E4720305E3DEAC65', 1, '<p>V F F</p>\n', x'5AFD5372E4720305E3DEAC64', 0, '<p>V F V</p>\n', x'5AFD5372E4720305E3DEAC63', 0, '<p>F V F</p>\n', x'5AFD5372E4720305E3DEAC62', 0, '<p>F V V</p>\n', x'5AF7A7C3DADE1B4EE775C1FC', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD53DAE4720305E3DEAC67', '2018-05-15 13:36:53.284000', '<p>En la figura que se muestra, calcule el &aacute;ngulo de incidencia m&iacute;nimo del rayo incidente RI&nbsp;, tal que no se observe ning&uacute;n rayo en el medio 3.</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:143px; width:217px" /></p>\r\n', 'A', 1, x'5AFD53DAE4720305E3DEAC6C', 1, '<p>30&deg;</p>\n', x'5AFD53DAE4720305E3DEAC6B', 0, '<p>37&deg;</p>\n', x'5AFD53DAE4720305E3DEAC6A', 0, '<p>45&deg;</p>\n', x'5AFD53DAE4720305E3DEAC69', 0, '<p>53&deg;</p>\n', x'5AFD53DAE4720305E3DEAC68', 0, '<p>60&deg;</p>\n', x'5AF7A7C3DADE1B4EE775C1FC', 'RU');
