        (0, x'5AFD545DE4720305E3DEAC6D', '2018-05-15 13:36:53.284000', '<p><img src="data:image/png;base64," style="height:183px; width:589px" /></p>\r\n', 'A', 1, x'5AFD545DE4720305E3DEAC72', 0, '<p>Solo I</p>\n', x'5AFD545DE4720305E3DEAC71', 0, '<p>Solo II</p>\n', x'5AFD545DE4720305E3DEAC70', 0, '<p>Solo III</p>\n', x'5AFD545DE4720305E3DEAC6F', 1, '<p>I y II</p>\n', x'5AFD545DE4720305E3DEAC6E', 0, '<p>I, II y III</p>\n', x'5AF7ABD1DADE1B4EE775C220', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD549EE4720305E3DEAC73', '2018-05-15 13:36:53.284000', '<p>Respecto a las propiedades de la materia, &iquest;cu&aacute;les de las siguientes proposiciones son correctas?</p>\r\n\r\n<p>I. La densidad del agua l&iacute;quida es mayor que la del hielo.</p>\r\n\r\n<p>II. La energ&iacute;a es una propiedad intensiva.</p>\r\n\r\n<p>III. La temperatura de ebullici&oacute;n es una propiedad extensiva.</p>\r\n', 'A', 1, x'5AFD549EE4720305E3DEAC78', 1, '<p>Solo I</p>\n', x'5AFD549EE4720305E3DEAC77', 0, '<p>Solo II</p>\n', x'5AFD549EE4720305E3DEAC76', 0, '<p>Solo III</p>\n', x'5AFD549EE4720305E3DEAC75', 0, '<p>I y II</p>\n', x'5AFD549EE4720305E3DEAC74', 0, '<p>II y III</p>\n', x'5AF7AA9BDADE1B4EE775C209', 'RU');
INSERT INTO `tbl_preguntas` (`__v`, `_id`, `created_at`, `enunciado`, `estado`, `nivel`, `respuestas.0._id`, `respuestas.0.correcto`, `respuestas.0.descripcion`, `respuestas.1._id`, `respuestas.1.correcto`, `respuestas.1.descripcion`, `respuestas.2._id`, `respuestas.2.correcto`, `respuestas.2.descripcion`, `respuestas.3._id`, `respuestas.3.correcto`, `respuestas.3.descripcion`, `respuestas.4._id`, `respuestas.4.correcto`, `respuestas.4.descripcion`, `subtema_id`, `tipo`)
    VALUES
        (0, x'5AFD54D7E4720305E3DEAC79', '2018-05-15 13:36:53.284000', '<p>El aluminio, de color plateado, reacciona vigorosamente con bromo, un l&iacute;quido de color rojo naranja y de olor desagradable, formando bromuro de aluminio, una sustancia cristalina. Respecto al enunciado, indique la secuencia correcta, despu&eacute;s de determinar si la proposici&oacute;n es verdadera (V) o falsa (F):</p>\r\n\r\n<p>I. Se mencionan tres sustancias simples.</p>\r\n\r\n<p>II. Se produce un fen&oacute;meno f&iacute;sico entre el aluminio y el bromo.</p>\r\n\r\n<p>III. La sustancia formada es un compuesto.</p>\r\n', 'A', 1, x'5AFD54D7E4720305E3DEAC7E', 0, '<p>F F F</p>\n', x'5AFD54D7E4720305E3DEAC7D', 1, '<p>F F V</p>\n', x'5AFD54D7E4720305E3DEAC7C', 0, '<p>F V V</p>\n', x'5AFD54D7E4720305E3DEAC7B', 0, '<p>V V V</p>\n', x'5AFD54D7E4720305E3DEAC7A', 0, '<p>V F V</p>\n', x'5AF7AA96DADE1B4EE775C208', 'RU');
