        (0, x'5AFD55F5E4720305E3DEAC8B', '2018-05-15 13:36:53.284000', '<p>Al aplicar la regla de construcci&oacute;n (AUFBAU) y la regla de Hund, un elemento qu&iacute;mico queda con 3 orbitales semillenos en el tercer nivel de energ&iacute;a. &iquest;Cu&aacute;l de los siguientes podr&iacute;a ser el n&uacute;mero at&oacute;mico del elemento descrito?</p>\r\n', 'A', 1, x'5AFD55F5E4720305E3DEAC90', 0, '<p>16</p>\n', x'5AFD55F5E4720305E3DEAC8F', 0, '<p>19</p>\n', x'5AFD55F5E4720305E3DEAC8E', 1, '<p>23</p>\n', x'5AFD55F5E4720305E3DEAC8D', 0, '<p>28</p>\n', x'5AFD55F5E4720305E3DEAC8C', 0, '<p>30</p>\n', x'5AF7AB18DADE1B4EE775C214', 'RU');
