        (0, x'5AFD5A14E4720305E3DEACC1', '2018-05-15 13:36:53.284000', '<p>A continuaci&oacute;n se muestran diferentes piezas de hierro, conectados, o no, a otros metales. &iquest;En cu&aacute;les de los 3 casos ocurrir&aacute; corrosi&oacute;n en el hierro?</p>\r\n\r\n<p>E&deg; (V):</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:61px; width:179px" /></p>\r\n\r\n<p><img src="data:image/png;base64," style="height:92px; width:198px" /></p>\r\n\r\n<p><img src="data:image/png;base64," style="height:208px; width:160px" /></p>\r\n', 'A', 1, x'5AFD5A14E4720305E3DEACC6', 1, '<p>Solo I</p>\n', x'5AFD5A14E4720305E3DEACC5', 0, '<p>Solo II</p>\n', x'5AFD5A14E4720305E3DEACC4', 0, '<p>Solo III</p>\n', x'5AFD5A14E4720305E3DEACC3', 0, '<p>I y II</p>\n', x'5AFD5A14E4720305E3DEACC2', 0, '<p>I y III</p>\n', x'5AF7AECADADE1B4EE775C261', 'RU');
