    VALUES
        (0, x'5AFD5AA7E4720305E3DEACCD', '2018-05-15 13:36:53.284000', '<p>&iquest;Cu&aacute;les de los razonamientos siguientes son correctos y permitir&aacute; disminuir la contaminaci&oacute;n ambiental?</p>\r\n\r\n<p>I. La basura dom&eacute;stica abandonada en las calles contamina, por lo tanto, es mejor quemarla.</p>\r\n\r\n<p>II. Obtener energ&iacute;a de celdas de combustible es un proceso menos contaminante.</p>\r\n\r\n<p>III. Para las operaciones de limpieza es mejor usar detergentes biodegradables.</p>\r\n', 'A', 1, x'5AFD5AA7E4720305E3DEACD2', 0, '<p>I, II y III</p>\n', x'5AFD5AA7E4720305E3DEACD1', 1, '<p>II y III</p>\n', x'5AFD5AA7E4720305E3DEACD0', 0, '<p>I y III</p>\n', x'5AFD5AA7E4720305E3DEACCF', 0, '<p>Solo II</p>\n', x'5AFD5AA7E4720305E3DEACCE', 0, '<p>Solo III</p>\n', x'5AF7AFB3DADE1B4EE775C274', 'RU');
